import "../styles/components-style/Cards.css"
import { Link} from "react-router-dom"


function Cards({cover, title}) {
    return (
            <li className="elementCard">
            <Link className="lien" exact to='/fiche-logement/{id}'>
            <img src={cover} alt={`${title} cover`} className="cover"/>
            <h2 className="titre">{title}</h2>
            </Link>
            </li>
    )
};

export default Cards;
